column5:
description:{"en":"Scanlation as a hobby is the process of producing fan-made translations for manga. This comprehensive guide is designed to teach you everything you need to know in order to effectively get involved in all parts of the fan translation process. Knowledge of Japanese is not necessary to get involved!

Watch or listen to these guides on [youtube](https://www.youtube.com/channel/UCf5NNwKQ_DuA88YL5dPq5Dw/)
Collaborate with other manga fans at our [discord server](https://discord.scanco.org)"}

